$_MODULE['<{ets_contactform7}prestashop>help_f9654c9df3f610569dd727b769581e6f'] = 'Abyste mohli odpovídat na zprávy zákazníků přímo v back office, potřebujete svou e-mailovou adresu zákazníka. Při vytváření kontaktního formuláře nezapomeňte přidat pole pro zadání e-mailu a označit jej jako povinné pole.';
$_MODULE['<{ets_contactform7}prestashop>help_df8334930ebd39a1c1bd49057ddb3586'] = 'Konfigurace e-mailu';
